import React, { Component } from 'react';
import './App.css';
import MusicLibrary from './components/MusicLibrary.js';

 class App extends React.Component {
   render(){ 
     return (
     <MusicPlayerView>
     </MusicPlayerView>
     )
   }
}

class MusicPlayerView extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      playLists: Array(),
    }
    const myPlayList = this.state.playLists.slice();
    myPlayList[0] = 'Reaggy';

    this.setState({playLists: myPlayList});
  }
  render(){
    return (
    <div>
      <Playlist playLists = {this.state.playLists}></Playlist>
      <SoundTrackPlayer></SoundTrackPlayer>
      <ControlPanel></ControlPanel>
      <UploadView></UploadView>
    </div> )
  }
}

class Playlist extends React.Component{
  constructor(props){
    super(props);
    console.log(props.playLists);
  }
  render(){
    return <div><MusicLibrary playLists = {this.props.playLists}></MusicLibrary></div>
  }
}

class SoundTrackPlayer extends React.Component{
  render(){
    return <div>SoundTrackPlayer</div>
  }
}

class ControlPanel extends React.Component{
  render() {
    return <div>ControlPanel</div>
  }
}

class UploadView extends React.Component{
  render() {
    return <div>UploadView</div>
  }
}


export default App;
